    public void onCreate(SQLiteDatabase db) {
        boolean isFirstRun = false;
        Cursor cursor = db.rawQuery("SELECT count(name) FROM sqlite_master where name = 'main_player'", null);
        cursor.moveToFirst();
        if (cursor.getString(0).equals("0")) {
            isFirstRun = true;
        }
        cursor.close();
        if (isFirstRun) {
            db.execSQL(DATABASE_CREATE_SCRIPT_MAIN_PLAYER);
            db.execSQL(DATABASE_CREATE_TABLE_TANKS);
            db.execSQL(DATABASE_CREATE_TABLE_TANKS_EXP);
            db.execSQL(DATABASE_CREATE_TABLE_SH);
            db.execSQL("ALTER TABLE stat_history ADD last_battle");
            db.execSQL("ALTER TABLE stat_history ADD brone");
            db.execSQL("ALTER TABLE stat_history ADD max_exp text");
            db.execSQL("ALTER TABLE stat_history ADD wg text");
            db.execSQL("ALTER TABLE main_player ADD server text");
            db.execSQL("UPDATE main_player SET server ='RU'");
            db.execSQL(DATABASE_CREATE_TABLE_TANKS_EN);
        }
        cursor = db.rawQuery("SELECT count(name) FROM sqlite_master where name = 'tank_stat'", null);
        cursor.moveToFirst();
        if (cursor.getString(0).equals("0")) {
            db.execSQL(DATABASE_CREATE_TABLE_TANK_STAT);
        }
        cursor.close();
        cursor = db.rawQuery("SELECT count(name) FROM sqlite_master where name = 'tank_stat_last'", null);
        cursor.moveToFirst();
        if (cursor.getString(0).equals("0")) {
            db.execSQL(DATABASE_CREATE_TABLE_TANK_STAT_LAST);
        }
        cursor.close();
        createTanks(db);
        createWn8ExpTanks(db);
    }

    public void onUpgrade(SQLiteDatabase db, int oldVersion, int newVersion) {
        onCreate(db);
    }

